import ReactDOM from 'react-dom'
import React from 'react'
import './index.css'
import Hamburger from './hamburger-menu-white.svg'

function NavbarLogin() {
    return (
        <span class="navbar-child" id="login-span">
            <button id="login">
            </button>
        </span>
    )
}

function NavbarHamburger() {
    return (
        <span class="navbar-child">
            <button id="hamburger">
            </button>
        </span>
    )
}

function NavbarButton(props) {
    return (
        <span class="navbar-child">
            <button id="hamburger">
                <img 
                    src={props.buttonImage}
                    size="10%"></img>
            </button>
        </span>
    )
}

function NavbarTitle() {
    return (
        <span class="navbar-child" id="navbar-title">
            Museum
        </span>
    )
}

function Navbar() {
    return (
        <div class="navbar-main navbar-position">
            <NavbarButton buttonImage={Hamburger}/>
            <NavbarTitle />
            <NavbarLogin />
        </div>
    )
}

function Page() {
    return (
        <Navbar />
    )
}

ReactDOM.render(
    <Page />,
    document.getElementById('root')
);
